import React from "react";

export const GridItem = ({ title, text }) => {
  return (
    <>
      <h5>{title}</h5>
      <h3 className="p-2 text-balance">{text}</h3>
    </>
  );
};

export const GridItemWithImage = ({ title, text, image, alt }) => {
  return (
    <>
      <img src={image} alt={alt} className="mb-2" />
      <h5>{title}</h5>
      <span className="p-2 text-clip">{text}</span>
    </>
  );
};
